subproject.description:
(1) Dissemination of the 10 UN Global Compact Principles of sustainable development; 
(2) Implementation of the 10 UN Global Compact Principles into the practices of Russian and foreign companies in Russia;
(3) Involvement of participants of the UNGC Russia and other Russian businesses in applied projects on  sustainable  social and economic development of companies and territories in which those companies operate

